import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Container, Typography, Card, CardContent, CardMedia, Button, Grid, Box, Chip, Divider } from '@mui/material';

// Tipo para los detalles del doctor
interface DoctorDetails {
  id: number;
  name: string;
  specialty: string;
  rating: number;
  imageUrl: string;
  description: string;
  education: string[];
  experience: string;
  address: string;
  phone: string;
}

const DoctorDetail = () => {
  const { id } = useParams<{ id: string }>();
  const [doctor, setDoctor] = useState<DoctorDetails | null>(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    // Simulación de datos - en producción se obtendría de la API
    const mockDoctor: DoctorDetails = {
      id: Number(id),
      name: 'Dr. Juan Pérez',
      specialty: 'Cardiología',
      rating: 4.8,
      imageUrl: 'https://via.placeholder.com/300',
      description: 'Especialista en cardiología con más de 10 años de experiencia en el diagnóstico y tratamiento de enfermedades cardiovasculares.',
      education: [
        'Universidad Nacional de Medicina - Doctor en Medicina',
        'Hospital Central - Residencia en Medicina Interna',
        'Instituto Cardiovascular - Especialidad en Cardiología'
      ],
      experience: '10 años de experiencia en cardiología clínica',
      address: 'Av. Principal 123, Consultorio 405',
      phone: '+1 234 567 890'
    };
    
    setDoctor(mockDoctor);
    setLoading(false);
  }, [id]);

  if (loading) {
    return <Container><Typography>Cargando...</Typography></Container>;
  }

  if (!doctor) {
    return <Container><Typography>Doctor no encontrado</Typography></Container>;
  }

  return (
    <Container maxWidth="md" sx={{ mt: 4 }}>
      <Card sx={{ mb: 4 }}>
        <Grid container>
          <Grid item xs={12} md={4}>
            <CardMedia
              component="img"
              image={doctor.imageUrl}
              alt={doctor.name}
              sx={{ height: '100%', objectFit: 'cover' }}
            />
          </Grid>
          <Grid item xs={12} md={8}>
            <CardContent>
              <Typography variant="h4" component="h1" gutterBottom>
                {doctor.name}
              </Typography>
              <Chip label={doctor.specialty} color="primary" sx={{ mb: 2 }} />
              <Typography variant="body1" paragraph>
                {doctor.description}
              </Typography>
              <Typography variant="body2" color="text.secondary">
                Calificación: {doctor.rating}/5
              </Typography>
              <Button variant="contained" color="primary" sx={{ mt: 2 }}>
                Agendar Cita
              </Button>
            </CardContent>
          </Grid>
        </Grid>
      </Card>

      <Grid container spacing={3}>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Educación
              </Typography>
              <Divider sx={{ mb: 2 }} />
              {doctor.education.map((edu, index) => (
                <Typography key={index} variant="body2" paragraph>
                  • {edu}
                </Typography>
              ))}
            </CardContent>
          </Card>
        </Grid>
        <Grid item xs={12} md={6}>
          <Card>
            <CardContent>
              <Typography variant="h6" gutterBottom>
                Información de Contacto
              </Typography>
              <Divider sx={{ mb: 2 }} />
              <Typography variant="body2" paragraph>
                <strong>Dirección:</strong> {doctor.address}
              </Typography>
              <Typography variant="body2" paragraph>
                <strong>Teléfono:</strong> {doctor.phone}
              </Typography>
              <Typography variant="body2" paragraph>
                <strong>Experiencia:</strong> {doctor.experience}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
};

export default DoctorDetail;
